import Card from '../Card/Card';
import './Cards.css';
import { useSelector } from 'react-redux';

export default function Cards(props) {
    const dogShown = useSelector(store => store.dogShown)
    //paginado

    return (
        <div className="divCards">
            {
                dogShown.map((d, i) => {
                    return < Card
                        id={d.id}
                        name={d.name}
                        image={d.image}
                        temperament={d.temperament}
                        weight={d.weight}
                    />
                })
            }
        </div>
    )
}
